              Lorem Ipsum irréprochable. Le Lorem Ipsum ainsi obtenu ne contient
              aucune répétition, ni ne contient des mots farfelus, ou des
              touches d'humour.
            </p>
            <button className="btn ">TELECHARGER MON CV</button>
          </div>
        </div>
      </>
    );
  }
}

export default Portfolio;
